R["oh__@darquinn"]="{['Key']='oh__@darquinn',['Version']=1766,['TS']=1637847607,['na']={[81]={['O']=18945,['N']='Rördaveld High Hall',['D']='Come visit Rördaveld High Hall! Another massive interior space with custom builds that include collection room and bedroom on main floor, bathouse on second floor, custom build third floor with two additional bedrooms and a fourth floor grand library. ',['C']=1.040000,},[41]={['O']=18945,['N']='Rördaveld Grotto',['D']='Come visit Rördaveld Grotto! It\\'s a massive space with completely costom builds throughout that include 4 buildings, battlements, treasure room, courtyard and portals to Rördaveld High Hall. ',['C']=1.020000,},[70]={['O']=18956,['N']='Hero\\'s Rest',['D']='Come visit Hero\\'s Rest! Another custom build of a large multi zoned space. Main area has crafting room, peayer room, armory, barracks. One portal leads to a massive garden and another to a resort spa area. This is where the weary go to relax and recoup. Portals to other homes are through the gardens. ',['C']=1.021000,},[62]={['O']=18955,['N']='Villa Lumiere',['D']='Come visit Villa Lumiere! Every corner has a purpose in this custom interior build with a Meridia theme. Past the gates are blue and golden atriums. crafting and library terraces and an armory balcony. The wings have living quarters and dimly lit tasting hall with an inset terrarium. Head down behind to see the shrine to Meridia. Had a ton of fun with this one and using all 700 slots. ',['C']=1.020000,},},}"
