s and agrees with his girlfriend in everything, then he automatically gives her power. Some women are happy about this because now they dictate the rules of behavior and they don�t adjust to anyone. Others are upset that a man is weak because not all girls want to use their power. The more a man starts to humiliate, the less he is respected by a woman. In the end, a girl has nothing left but an aversion to him.\\n\\n\\n\\nSometimes a lady has no other choice but to take the reins of government into her own hands and become a Dominat',['title']='Dominant Woman Submissive Man Relationship: How to Make It Work',},['Yaw']=3.490700,},[68]={['Groups']=0,['Color']=999998,['Y']=13177,['Z']=80721,['EffectType']=563,['Roll']=0,['X']=77966,['Pitch']=0,['Contrast']=1,['SizeX']=90,['SizeZ']=58,['Alpha']=1,['SizeY']=58,['Id']=1203,['Yaw']=3.141600,},[69]={['Id']=1208,['Color']=163862,['Y']=11478,['EffectType']=8502,['Z']=80248,['Groups']=3.440000,['Roll']=0,['X']=82253,['SizeZ']=30,['Contrast']=1,['SizeX']=26.456456,['Pitch']=4.789200,['Alpha']=1,['SizeY']=30,['MetaData']={['message']='There are many ways to lose one\\'s life other than death. Imagine never being able to move, to speak. You are trapped in a body like a prisoner in a ceil. Eyes are your only window to the outside. If only you could feel the touch of someone. You can not feel anything. Realizing no one knows you. Your wants, your passions, your lusts. The sound of your own heart driving you mad with every thump. Welcome to my Nightmare.',['title']='Welcome',},['Yaw']=1.926800,},[70]={['Groups']=0,['Color']=999998,['Y']=11641,['Z']=79754,['EffectType']=609,['Roll']=0,['X']=81561,['Pitch']=5.934100,['Contrast']=1.660000,['SizeX']=500,['SizeZ']=500,['Alpha']=1,['SizeY']=500,['Id']=1209,['Yaw']=0,},[71]={['Groups']=0,['Color']=999998,['Y']=11641,['Z']=79773,['EffectType']=609,['Roll']=0,['X']=81402,['Pitch']=5.934100,['Contrast']=1.660000,['SizeX']=500,['SizeZ']=500,['Alpha']=1,['SizeY']=500,['Id']=1210,['Yaw']=0,},[72