R["fx__na__@mahvirnadas__25"]="{['Effects']={[1]={['Groups']=0,['Y']=11439,['SizeZ']=30,['Contrast']=2,['Color']=559297,['Id']=1376,['X']=22460.823920,['Roll']=0,['Z']=44344.246869,['SizeY']=30,['EffectType']=8502,['SizeX']=26.456456,['MetaData']={['title']='Things Arvos Likes',['message']='(roughly scrawled note with several points lined through)\\n\\n1. Books\\n2. Tea\\n3. Wine\\n4. Sleeping\\n5. Snoring\\n6. (crossed out heavily)\\n7. Eating\\n8. Flowers\\n9. Baths\\n10. Pillows\\n11. Warmth\\n12. (illegible)\\n\\n\\n\\n\\n\\n\\n- Remember to make a fire',},['Yaw']=1.513200,['Alpha']=1,['Pitch']=4.719370,},[2]={['Groups']=0,['Y']=12196,['SizeZ']=30,['Contrast']=1,['Color']=629399,['Id']=1377,['X']=22636.227024,['Roll']=0,['Z']=44642.518197,['SizeY']=30,['EffectType']=8501,['SizeX']=26.456456,['MetaData']={['title']='A Note From Arvos',['message']='Dear Nezzokar,\\n   It was incredibly thoughtful that you modified your sanctuary to accomodate me darlin\\', but not even I need 10 tea kettles.\\n\\n   I\\'ll return soon, off to buy more tea.\\n   -Eternally, \\n    Arvos\\n\\nP.S.  I did notice the books. \\nI have SO. MANY. QUESTIONS.',},['Yaw']=1.609194,['Alpha']=1,['Pitch']=4.886922,},[3]={['Groups']=0,['Y']=14737,['SizeZ']=30,['Contrast']=2.500000,['Color']=20414,['Id']=1378,['X']=23008.082654,['Roll']=0,['Z']=47071.840416,['SizeY']=30,['EffectType']=8501,['SizeX']=26.456456,['MetaData']={['title']='Unexpected Progress',['message']='7th of Sun\\'s Dusk\\n\\n   The plants endemic to my home have grown poorly here.  It is perhaps too green, and too wet. Ash infusions proved not enough, and despite my efforts they grew weak and sickly. I expected nothing short of attempting to create lava, or reconnecting my sanctuary to the Deadlands to have any meaningful effect. Though, that last act would draw far too much attention... From too many.  Now, it seems that will be unnecessary.  \\n\\n   During our last expedition Arvos pointed out a most peculiar plant.  It stole my curiosity most completely. He and I took cuttings while I tried to understand what about it seemed so very familiar and why it reminded me of my homelands.  It was not until many weeks had passed, these small luminous plants readily overtaking my sanctuary, did I finally understand why.  \\n\\n   Around every transplant, the Deadland varieties had begun to flourish.  I cautiously suspect these plants naturally give off the same sort of light to that of lava flows in my native realm.  \\n\\n   I am no expert in such things, however I do know caring for these strange plants is much less dangerous than attempting lava.',},['Yaw']=3.096214,['Alpha']=1,['Pitch']=4.708898,},[4]={['Groups']=1,['Y']=15123,['SizeZ']=1300,['Color']=10099,['Contrast']=1,['Id']=1380,['Roll']=0,['Z']=45940.735900,['SizeY']=1300,['EffectType']=32,['SizeX']=780,['X']=22765.475276,['Yaw']=3.131121,['Alpha']=0.320000,['Pitch']=1.570971,},[5]={['Groups']=0,['Y']=14959,['SizeZ']=600,['Contrast']=1,['Color']=494949,['Id']=1381,['X']=22782.015331,['Roll']=0,['Z']=45934.828530,['SizeY']=600,['EffectType']=914,['SizeX']=600,['MetaData']={['target effect']=99990001,},['Yaw']=3.063053,['Alpha']=1,['Pitch']=0,},[6]={['Groups']=0,['Y']=14879,['SizeZ']=1000,['Contrast']=1,['Color']=494949,['Id']=1382,['X']=22705.873724,['Roll']=0,['Z']=45702.435187,['SizeY']=1000,['EffectType']=1004,['SizeX']=1000,['MetaData']={['furniture']='4730716583155844661',},['Yaw']=2.234021,['Alpha']=1,['Pitch']=0,},[7]={['Groups']=0,['Y']=15645,['SizeZ']=4000,['Color']=999989,['Contrast']=1,['Id']=1385,['Roll']=0,['Z']=45741.298972,['SizeY']=1,['EffectType']=63,['SizeX']=4000,['X']=21419.259345,['Yaw']=1.382301,['Alpha']=0.250000,['Pitch']=0,},[8]={['Id']=1393,['Y']=14934,['SizeZ']=820,['Color']=263899,['Contrast']=1,['EffectType']=4529,['Roll']=0,['Z']=45387.240346,['SizeY']=820,['SizeX']=600,['Alpha']=0.660000,['X']=20774.981760,['Yaw']=1.546362,['Groups']=0,['Pitch']=0,},},['Version']=1766,['TS']=1637657588,}"
