ished, and contain a return portal to this hall (or an adjacent house), with a circle of magicka; that way you may know which houses offer a safe return. \\n\\nThank you so very much for visiting any of my many homes.  I hope you have a lovely stay.\\n\\n-Mahvir\\n',},['Yaw']=0.780200,['Z']=25152,['Alpha']=1,['X']=26009,['SizeZ']=30,['Roll']=0,['Y']=20145,['EffectType']=8503,['Id']=1144,},[24]={['Y']=20236,['Yaw']=2.326524,['Alpha']=1,['Color']=599955,['Groups']=0,['SizeY']=700,['Pitch']=0,['Z']=25987.649128,['Id']=1173,['X']=25271.856515,['SizeZ']=700,['Roll']=0,['Contrast']=1,['EffectType']=4548,['SizeX']=580,},[25]={['Color']=999999,['Contrast']=4,['Pitch']=0,['SizeY']=100,['SizeX']=280,['Groups']=0,['MetaData']={['message']='Thinly Veiled B&B\\n   Hakkvild\\'s',},['Yaw']=2.363176,['Z']=25943.515577,['Alpha']=1,['X']=25322.211448,['SizeZ']=100,['Roll']=0,['Y']=20536,['EffectType']=4400,['Id']=1175,},[26]={['Y']=21089,['Yaw']=0.822050,['Alpha']=1,['Color']=829995,['Groups']=0,['SizeY']=600,['Pitch']=0,['Z']=24022.909559,['Id']=1176,['X']=25770.323558,['SizeZ']=600,['Roll']=0,['Contrast']=1,['EffectType']=4571,['SizeX']=440,},[27]={['Color']=999998,['Contrast']=1,['Pitch']=0,['SizeY']=80,['SizeX']=240,['Groups']=0,['MetaData']={['message']=' Testing ground\\n(Currently A\\'aru)',},['Yaw']=0.787143,['Z']=24084.892989,['Alpha']=1,['X']=25820.274141,['SizeZ']=80,['Roll']=0,['Y']=21330,['EffectType']=4400,['Id']=1177,},[28]={['Y']=21065,['Yaw']=2.394592,['Alpha']=1,['Color']=223699,['Groups']=0,['SizeY']=500,['Pitch']=0,['Z']=25048.717964,['Id']=1179,['X']=24932.949415,['SizeZ']=500,['Roll']=0,['Contrast']=1,['EffectType']=4578,['SizeX']=379,},[29]={['Color']=173624,['Contrast']=1.500000,['Pitch']=4.799655,['SizeY']=30,['SizeX']=26.456456,['Groups']=0,['MetaData']={['title']='A Note from Vivyne',['message']='   Dear Nelrinar,\\n(and everyone else I suppose)\\n\\nSince we are essentially now neighbors, I feel I should warn you, and anyone else, not to visit my home during a full moon, unless of course it is an emergency that requires my expertise.  And actually, do not visit anytime before midday unless you wish to see entirely too much of Malthus greeting the sun, or whatever he calls it.  Thank you by the way, for that bundle of problems in the shape of a man... (usually).  I\\'ll have you know I was entirely content here by myself.\\n\\nMalthus says Hi. \\n-Vivyne \\n\\nPS: I\\'ve enclosed eight more sausage centric recipes I found.  Now why my grandmother seemed to think they needed to be buried in the garden is beyond me, however you\\'ll be thrilled to know at least they\\'re not cursed this time.',},['Yaw']=0.785398,['Z']=24257.589780,['Alpha']=1,['X']=25664.023689,['SizeZ']=30,['Roll']=0,['Y']=20177,['EffectType']=8503,['Id']=1180,},[30]={['Color']=203932,['Contrast']=1,['Pitch']=1.570971,['SizeY']=30,['SizeX']=26.456456,['Groups']=0,['MetaData']={['title']='A Note from Anevi',['message']='To whom it may concern,\\n\\nI cannot believe I have to write this, but please, PLEASE, secure your belongings before visiting our home.  Nelrinar has taught the netches how to pick pockets and we have yet to find all of their hiding places.\\n\\nArvos, If you see this, Nel is still looking for that amulet.  I will send it on as soon as it\\'s found.  ',},['Yaw']=4.026475,['Z']=24566.982628,['Alpha']=1,['X']=26718.193544,['SizeZ']=30,['Roll']=0,['Y']=20146,['EffectType']=8503,['Id']=1280,},[31]={['Color']=92642,['Contrast']=1,['Pitch']=4.712564,['SizeY']=30,['SizeX']=26.456456,['Groups']=0,['MetaData']={['title']='A Brief Apology',['message']='Dear... well, everyone.\\n\\nSome of you may already know, as many of us were in attendance of my party last Fredas- However in case any of you don\\'t or drank enough to forget... It would appear that Nezzokar somehow absconded with almost all of the doors to our little party outpost. I feel I must apologize (because he won\\'t) and express that it is unlikely that we will be able to retrieve them (as they have likely been banished to an obscure pocket of Oblivion). And well, you know how lousy his sense of direction is.  Better count them gone.  \\n\\nIt is my hope to have procured new (and somehow less offensive) doors before winter sets in, if not sooner.  Pack warm clothes if you plan to visit before I\\'ve done so.\\n\\nMost Sincerely, \\n-Arvos Uveran\\n\\n\\n\\n(barely legible almost daedric-like scratchings)\\nLESS SINCERELY\\n-NEZZOKAR',},['Yaw']=2.125811,['Z']=25472.816480,['Alpha']=1,['X']=24906.941038,['SizeZ']=30,['Roll']=0,['Y']=20149,['EffectType']=8503,['Id']=1281,},[32]={['Y']=21087,['Yaw']=3.947935,['Alpha']=1,['Color']=628599,['Groups']=0,['SizeY']=600,['Pitch']=0,['Z']=24815.685397,['Id']=1282,['X']=26647.110267,['SizeZ']=600,['Roll']=0,['Contrast']=1,['EffectType']=4558,['SizeX']=320,},[33]={['Color']=999999,['Contrast']=1,['Pitch']=0,['SizeY']=60,['SizeX']=260,['Groups']=0,['MetaData']={['message']='Auri-El Suite\\n Alinor Inn',},['Yaw']=3.967133,['Z']=24705.712330,['Alpha']=1,['X']=26531.337645,['SizeZ']=60,['Roll']=0,['Y']=21287,['EffectType']=4400,['Id']=1284,},[34]={['Y']=21088,['Yaw']=3.930481,['Alpha']=1,['Color']=999999,['Groups']=0,['SizeY']=600,['Pitch']=0,['Z']=24460.320686,['Id']=1359,['X']=26971.387926,['SizeZ']=600,['Roll']=0,['Contrast']=1,['EffectType']=4580,['SizeX']=400,},[35]={['Y']=20898,['Yaw']=4.581489,['Alpha']=1,['Color']=263860,['Groups']=0,['SizeY']=116,['Pitch']=5.846853,['Z']=25018.677191,['Id']=1360,['X']=26171.783244,['SizeZ']=116,['Roll']=0,['Contrast']=0.680000,['EffectType']=493,['SizeX']=172,},[36]={['Color']=99,['Contrast']=1.880000,['Pitch']=5.857325,['SizeY']=60,['SizeX']=140,['Groups']=0,['MetaData']={['message']='DO NOT \\nENTER',},['Yaw']=4.604179,['Z']=25043.973824,['Alpha']=0.750000,['X']=26158.168108,['SizeZ']=60,['Roll']=0,['Y']=20885,['EffectType']=4406,['Id']=1361,},[37]={['Y']=20902,['Yaw']=3.349287,['Alpha']=1,['Color']=263860,['Groups']=0,['SizeY']=116,['Pitch']=6.108652,['Z']=25338.536274