R["oh__@dara_shadowmane"]="{['Version']=1766,['Key']='oh__@dara_shadowmane',['TS']=1636951684,['na']={[48]={['O']=18935,['D']='Welcome and feel free to look around.  {Please use the stairs.} This is my rendition of Whiterun from ES V:Skyrim and includes Breezehome.  It isn\\'t a perfect replica but I like it.  This is the second of my replica builds (Proudspire manor from ES V is my other build).  I hope you enjoy it and thank you for visiting.',['C']=1.041000,['N']='Falkreath Hall',},[49]={['O']=18874,['D']='I am re-opening this house (lost all Fx and slowly adding them back).  Enjoy and thank you for visiting.',['C']=1.020000,['N']='Witches Hut',},[19]={['O']=18757,['C']=1.002000,['N']='Best ESO Invention',},[22]={['O']=18870,['D']='I am re-opening this house.  Welcome to my coffeeshop.  This is the very first house I decorated.  Enjoy and thank you for visiting.  \\nPS: there is an \"easter egg\" so look carefully.',['C']=1.024000,['N']='Guild Coffeeshop',},[71]={['O']=18855,['D']='I am re-opening this house (lost all Fx and slowly adding them back).  I may have changed an effect or two, in case you have visited before.  Please read the book at the beginning if you want the backstory for the house.  Enjoy and thank you for visiting.',['C']=1.021000,['N']='Inspiration House',},[62]={['O']=18855,['N']='Sil-Var Monastary',},[9]={['O']=18755,['C']=1.021000,['N']='Mathiisen House',},[42]={['O']=18870,['D']='I am re-opening this house (lost all Fx and slowly adding them back).  This was for a Valentine\\'s Day contest sponsored by StabbityDoom.  Please follow her on Twitch (Twitch.tv/stabbitydoom).  She is a great housing streamer. ',['C']=1.002000,['N']='Celebrate True Love',},[80]={['O']=18943,['D']='They say build what you know...and I know pvp. This is an immersive pvp \\r\\rbuild. The main players are AD and EP but DC is present and they all \\r\\r\\nthink they are in Cyrodiil. (There are 3 books to read if you want to \\r\\rknow the build\\'s backstory.) Feel free to use for roleplay or dueling\\r\\r (please be respectful to the NPCs). You should see 60 Fx, if not then \\r\\r\\nplease email me.  Thank you and have fun.',['C']=1.026000,['N']='Irnskar\\'s Folly',},[23]={['O']=18875,['D']='LOCATION! LOCATION! LOCATION!\\nWhat more could a young, upwardly mobile Khajiit/Argonian want. Boasting a 1 bedroom, 2 kitchen (inside and out) living space. Close to shops and fine dining. (You can enter the house if you angle  at the door) Thank you for visiting.',['C']=1.026000,['N']='Khargorcian Classic',},[77]={['O']=18843,['D']='I am re-opening this house since I lost all of my Fx.  I made a few minor changes and added a category.',['C']=1.036000,['N']='Sir Socks Snow Globe',},[78]={['O']=18847,['D']='',['C']=1.026000,['N']='Solitude Townhouse',},[57]={['O']=18873,['D']='I am re-opening this house (lost all Fx and slowly adding them back).  Welcome to the 5-Finger Emporium.  Please start your tour at the dock and thank you for visiting.  This house could also be used for RP.',['C']=1.026000,['N']='Five-Finger Emporium',},},}"
