R["oh__@djuske"]="{['TS']=1635601944,['eu']={[49]={['N']='Evergloam Glade',['O']=18911,['C']=1.043000,['D']='Welcome to a quiet and very very safe part of the Evergloam! There is nothing to fear here, travellers! Come, rest, you must be so tired. Would it be so bad if you just... fell asleep? You deserve rest.\\n\\nWhat? No, there are no strange sounds. It\\'s just your imagination running wild again. Just close your eyes for a second. You are safe, I promise!\\n\\n(best viewed at night, with no music and full ambience)',},[81]={['N']='Mages Collective',['O']=18930,['C']=1.023000,['D']='Happy Witches Festival! Hidden away in the Skyrim wilderness is a collective of outcast mages and criminals conducting their illegal experiments - and said experiments have all gone horribly wrong! There are eight researchers; navigate the dungeon and find all studies and find out what happened to them! \\n\\nChecklist:\\n- the summoner\\n- the alchemist\\n- the necromancer\\n- the cultist\\n- the dwemer researcher\\n- the star-gazer\\n- the beastmaster\\n- the antiquarian',},[71]={['N']='Baandari Village',['O']=18733,},},['Version']=1766,['Key']='oh__@djuske',}"
