R["oh__@cerulione"]="{['TS']=1633604010,['Version']=1762,['eu']={[88]={['N']='The Witchery',['O']=18840,['C']=1.024000,['D']='Tea and cakes, or a freshly brewed potion…? Whether you are after a dainty afternoon tea as traditionally served in the Woodland Realm or a sumptuous midnight feast fit for a Vampire Lord, The Witchery By The Castle offers an unforgettable dining experience in unique atmosphere to all visitors since the First Era. We only use fresh locally sourced ingredients, all brewed and prepared by our resident Witch. For table reservation please send your mailer crow today.',},[89]={['N']='The Sixth Station',['O']=18870,['C']=1.020000,['D']='Loosely inspired by Studio Ghibli’s Spirited Away, The Sixth Station is an invitation for a journey to the unknown, as well as a call to return to a simpler and more meaningful way of life. Please hand your ticket to the controller to board the train. \\r\\n\\r\\nPS: For optimum experience, a night-time visit is preferred. Please stay on the track for your own safety.\\r\\n',},[59]={['N']='Printanière',['O']=18907,['C']=1.034000,['D']='A private residence, a house named after the first whisper of Spring. Enter, stranger, and be welcome among friensd.',},[28]={['N']='Ruska',['O']=18887,['C']=1.050000,['D']='Located on a height overlooking Nimalten, Ruska is an ode to the autumnal change of colours of the surrounding forest.\\n \\r\\nThis modern style cottage offers a built-in fireplace for those crisp autumn evenings, as well as a kitchen, a mezzanine sleeping area, and a large deck equipped with grill and stargazing telescope. It also features large floor-to-ceiling window and skylight that allows undisturbed view to surrounding forest and the northern light from indoor.\\r',},[70]={['N']='The Vigil\\'s Hall',['O']=18855,['C']=1.025000,['D']='Few remembered the initial purpose of the Vigil’s Hall, built in Ages past beyond counting. Today, it is home to more than three hundred documents, from records of events past and those who are yet to come. Of old songs and tales. Of knowledges forgotten by memories. \\r\\nIn this vast Hall lays the portal to the Vigil’s Watch, a secluded corner where in Ages past, a lone vigil was tasked to keep watch over the Demons’ Prison.\\r',},[25]={['N']='Atelier Narya',['O']=18891,['C']=1.500000,['D']='Located in the small but lively town of Bandaari Trading Post in Malabal Tor, Atelier Narya is the home and private art studio of a retired Dark Sister who had put down her Blade to take up brushes and pottery clays. ',},},['Key']='oh__@cerulione',}"
